import React from 'react';
import '../styles/portfolioStyles/portfolio.scss';
import AOS from "aos";
import { FcLink } from "react-icons/fc";
import "aos/dist/aos.css";

function PortfolioItem(itemTitle, itemLink) {
    console.log()
    return (
        <p className="portfolio-item" data-aos="zoom-out">
            <a href={itemLink.itemLink} target="blank">
                <FcLink /> {itemTitle.itemTitle}
            </a>
        </p>
    );
}

export default PortfolioItem;
